import { useNavigate } from "react-router-dom"
import Speciality from "./Speciality"

const ServicesPage = ( ) => {
    const navigate = useNavigate()
    const specialities = fetchSpecialities()

    const onLogOutSubmit = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }

    const fetchSpecialities = async () => {
        const res = await fetch(`http://localhost:8080/specialities`)
        const data = await res.json()

        const specialities = data.findAll()

        return specialities
    }

    return (
        <div>
            <div class = "row">
                <div style={{color: '#0b4a2b', marginLeft : 50, fontSize : 50}}>DocConnect</div>
                <button className = "btn" style = {{marginLeft : 1000}} type="submit" id='btn-log-out' onClick={(e) => onLogOutSubmit(e)}>
                    Log out
                </button>
            </div>
            <div>
                <div class = "container-2">
                    <div class = "container-3">
                        {specialities.map((speciality) => (
                            <Speciality key = {speciality.id} speciality = {speciality.name} />
                        ))}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ServicesPage
